import React from "react";
import {Context} from "../context";
import {Selecion} from "../components/Selecion";
import {Modal} from "../components/modal";

function AppUI() {
  const {
    openModal} = React.useContext(Context);
  return <React.Fragment>
    {!!openModal &&
     <Modal>
         <Selecion />
     </Modal>
    }
    </React.Fragment>;
}

export {AppUI};
